import React from "react";
import mainBackground from "./mainImages/BlueBackground.png";
import NavBar from "./Nav-Bar.js";
import Skills from "./Skills.js";
import About from "./About.js";
import "./App.css";

export default function Home() {
  return (
    <div className="App">
      <NavBar />
      <body>

        <container className="Home-Page">
          <img className="Background" src={mainBackground} alt="Tokyo Cityscape Background" />

          </container>


        <About />
        <Skills />
      </body>
    </div>
  );
}
